t stop racist \u0026 damaging behavior that we ourselves purposefully or passively participate in - It has emboldened us to stop it as it occurs in front of us, beside us, and around us in our own homes, in our own societies, in our schools \u0026 in our laws. \nIt is our responsibility as the majority to speak for the minority. \nIt is our responsibility to demand equality \u0026 change. \nIt is our responsibility to put in the hard work. \nAnd I\u2019ll be there working hard beside you all. \nAll my love to you guys!"}}]},"edge_media_to_comment":{"count":362},"comments_disabled":false,"taken_at_timestamp":1592642773,"edge_liked_by":{"count":15013},"edge_media_preview_like":{"count":15013},"location":null,"thumbnail_src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/sh0.08/e35/c0.280.720.720a/s640x640/104318666_653906252005348_8192708707086916261_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=104\u0026_nc_ohc=4aycB5v4iIkAX_VZhnR\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=334167d027ea3353f6f2f0231c1af3ef\u0026oe=6070F645\u0026_nc_sid=7bff83","thumbnail_resources":[{"src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/p150x150/104318666_653906252005348_8192708707086916261_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=104\u0026_nc_ohc=4aycB5v4iIkAX_VZhnR\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=4682f7f2687761cb64b076e4ce0b8724\u0026oe=60709AA5\u0026_nc_sid=7bff83","config_width":150,"config_height":266},{"src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/p240x240/104318666_653906252005348_8192708707086916261_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=104\u0026_nc_ohc=4aycB5v4iIkAX_VZhnR\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=72d8cef54c7bcdc02ce623f2a7ab9400\u0026oe=6070FEE3\u0026_nc_sid=7bff83","config_width":240,"config_height":426},{"src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/p320x320/104318666_653906252005348_8192708707086916261_n.jpg?tp
